    /*compute denominator in eq 12 first */
    CW += c[0]*1.007970; /*H */
    CW += c[1]*15.999400; /*O */
    CW += c[2]*17.007370; /*OH */
    CW += c[3]*33.006770; /*HO2 */
    CW += c[4]*2.015940; /*H2 */
    CW += c[5]*18.015340; /*H2O */
    CW += c[6]*34.014740; /*H2O2 */
    CW += c[7]*31.998800; /*O2 */
    CW += c[8]*13.019120; /*CH */
    CW += c[9]*14.027090; /*CH2 */
    CW += c[10]*14.027090; /*CH2* */
    CW += c[11]*15.035060; /*CH3 */
    CW += c[12]*16.043030; /*CH4 */
    CW += c[13]*29.018520; /*HCO */
    CW += c[14]*30.026490; /*CH2O */
    CW += c[15]*31.034460; /*CH3O */
    CW += c[16]*31.034460; /*CH2OH */
    CW += c[17]*32.042430; /*CH3OH */
    CW += c[18]*28.010550; /*CO */
    CW += c[19]*44.009950; /*CO2 */
    CW += c[20]*25.030270; /*C2H */
    CW += c[21]*26.038240; /*C2H2 */
    CW += c[22]*27.046210; /*C2H3 */
    CW += c[23]*28.054180; /*C2H4 */
    CW += c[24]*29.062150; /*C2H5 */
    CW += c[25]*30.070120; /*C2H6 */
    CW += c[26]*41.029670; /*HCCO */
    CW += c[27]*42.037640; /*CH2CO */
    CW += c[28]*43.045610; /*CH3CO */
    CW += c[29]*43.045610; /*CH2CHO */
    CW += c[30]*44.053580; /*CH3CHO */
    CW += c[31]*39.057360; /*C3H3 */
    CW += c[32]*40.065330; /*pC3H4 */
    CW += c[33]*40.065330; /*aC3H4 */
    CW += c[34]*41.073300; /*aC3H5 */
    CW += c[35]*41.073300; /*CH3CCH2 */
    CW += c[36]*42.081270; /*C3H6 */
    CW += c[37]*43.089240; /*nC3H7 */
    CW += c[38]*43.089240; /*iC3H7 */
    CW += c[39]*56.064730; /*C2H3CHO */
    CW += c[40]*50.060540; /*C4H2 */
    CW += c[41]*51.068510; /*iC4H3 */
    CW += c[42]*52.076480; /*C4H4 */
    CW += c[43]*53.084450; /*iC4H5 */
    CW += c[44]*53.084450; /*C4H5-2 */
    CW += c[45]*54.092420; /*C4H6 */
    CW += c[46]*54.092420; /*C4H612 */
    CW += c[47]*54.092420; /*C4H6-2 */
    CW += c[48]*55.100390; /*C4H7 */
