    dqdc[33] = dcdc_fac;
    dqdc[34] = dcdc_fac;
    dqdc[35] = dcdc_fac;
    dqdc[36] = dcdc_fac;
    dqdc[37] = dcdc_fac;
    dqdc[38] = dcdc_fac;
    dqdc[39] = dcdc_fac;
    dqdc[40] = dcdc_fac;
    dqdc[41] = dcdc_fac;
    dqdc[42] = dcdc_fac;
    dqdc[43] = dcdc_fac;
    dqdc[44] = dcdc_fac;
    dqdc[45] = dcdc_fac;
    dqdc[46] = dcdc_fac;
    dqdc[47] = dcdc_fac;
    dqdc[48] = dcdc_fac;
    dqdc[49] = dcdc_fac;
    dqdc[50] = dcdc_fac;
    dqdc[51] = dcdc_fac;
    dqdc[52] = dcdc_fac;
    dqdc[53] = dcdc_fac;
    dqdc[54] = dcdc_fac;
