    kc[4] = 1.0 / (refC) * exp((g_RT[14] + g_RT[0]) - (g_RT[16]));

    /*reaction 6: CH2O + H (+M) <=> CH3O (+M) */
    kc[5] = 1.0 / (refC) * exp((g_RT[14] + g_RT[0]) - (g_RT[15]));

    /*reaction 7: CH3 + H (+M) <=> CH4 (+M) */
    kc[6] = 1.0 / (refC) * exp((g_RT[11] + g_RT[0]) - (g_RT[12]));

    /*reaction 8: CH3 + OH (+M) <=> CH3OH (+M) */
    kc[7] = 1.0 / (refC) * exp((g_RT[11] + g_RT[2]) - (g_RT[17]));

